found = []
not_found = []

def find(s: str, word: str) -> bool:
    remain = len(word)
    wi_l = 0
    wi_r = len(word) - 1
    si_l = 0
    si_r = len(s) - 1
    pivot = int(len(s) / 2) + len(s) % 2
    while remain > 0:
        if word[wi_l] == s[si_l]:
            wi_l += 1
            remain -= 1
        si_l += 1
        if word[wi_r] == s[si_r]:
            wi_r -= 1
            remain -= 1
        si_r -= 1
        if si_l == pivot:
            break
    if remain > 0:
        global not_found
        not_found.append(word)
        return False
    global found
    found.append(word)
    return True

class Solution:
    def numMatchingSubseq(self, s: str, words: [str]) -> int:
        global found
        matches = 0
        for word in words:
            if word in found:
                matches += 1
                continue
            if word in not_found:
                continue
            if find(s, word):
                matches += 1
        return matches

